package com.day1.bean;

public class Rectangel implements Shape {

	private double with;
	private double length;
	
	public Rectangel(double with, double length){
		this.with = with;
		this.length = length;
	}
	public Rectangel(){
		
	}
	public double getWith() {
		return with;
	}

	public void setWith(double with) {
		this.with = with;
	}

	public double getLength() {
		return length;
	}

	public void setLength(double length) {
		this.length = length;
	}

	@Override
	public double area() {
		// TODO Auto-generated method stub
		return this.length*this.with;
	}

}
